import React from "react";

 import login from "./login";




var isLoggedIn=false;

function  renderConditionally(){
  if(isLoggedIn===true){
    return       <h1>Hello</h1>

  }else{
    return <login/>;
  }
}

function App() {
  return (
    <div className="container">
      {renderConditionally()}

    </div>
  );
}

export default App;
